export type Question = {
    category: string
    correct_answer: string
    difficulty: string
    incorrect_answers: string[]
    question: string
    type: string
}

export type QuestionState = Question & { answers: any[]}

export type UserAnswer = {
    question: string;
    answer: string;
    correct: boolean;
    correct_answer: string;
  };


export enum Difficulty  {
    EASY = 'easy',
    MEDIUM = 'medium',
    HARD = 'hard'
}
